import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {BrowserRouter as Router, Switch} from 'react-router-dom';
import { ADMIN, VENDEDOR, PENDIENTE, UNAUTHORIZED, LOGIN } from './path';
import AuthContextProvider from './components/login/authContext';
import ProtectedRoute from './components/login/ProtectedRoute';
import PublicRoute from './components/login/PublicRoute';
import Login from './components/login/Login';
import SignUp from './components/admin/createUser.js';
import Pendiente from './components/views/pendiente';
import CreatePoduct from './components/product/createProduct';
import Unauthorized from './components/views/unauthorized';
import Navbar from './components/navbar/Navbar';

function App() {
  return (
    <div className="App">
      
    <Navbar />
      <AuthContextProvider>
        <Router>
          <Switch>
            <PublicRoute exact path={LOGIN} component={Login} />
            <PublicRoute exact path={PENDIENTE} component={Pendiente} />
            <PublicRoute exact path={UNAUTHORIZED} component={Unauthorized} />
            <ProtectedRoute path={ADMIN} component={SignUp} />
            <ProtectedRoute path={VENDEDOR} component={CreatePoduct} />
            <PublicRoute path="*" component={() => "404 NOT FOUND"} />
          </Switch>
        </Router>
      </AuthContextProvider>
    </div>
  );
}

export default App;
